    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_all_street_view);

        try {

            context = AllStreetViewActivity.this;
            tvTitle = findViewById(R.id.tvTitle);

            Bundle bundle = getIntent().getExtras();
            if (bundle != null) {
                listOptions(bundle.getString(TYPE_KEY, ""));
            }
            lvfamus = findViewById(R.id.rvItems);
            lvfamus.setLayoutManager(new GridLayoutManager(context, 2));
            lvfamus.setAdapter(new AllStreetViewAdaptor(this, placesModelList));

            AppPurchasePref appPurchasePref = new AppPurchasePref(getApplicationContext());
            if (appPurchasePref.getItemDetail().equals("") && appPurchasePref.getProductId().equals("")) {

                BannerAdmob();
                mInterstitialAd = new InterstitialAd(this);
                mInterstitialAd.setAdUnitId(getString(R.string.interstitial_full_screen));
                requestNewInterstitial();
                mInterstitialAd.setAdListener(new AdListener() {
                    @Override
                    public void onAdClosed() {
                        super.onAdClosed();
                        requestNewInterstitial();
                        onClickListener(mPosition);

                    }
                });
            }
        } catch (Exception ignored) {
        }
    }

