    public class AllStreetViewAdaptor extends RecyclerView.Adapter<AllStreetViewAdaptor.ViewHolder> {

        Context context;
        List<StreetViewModel> list;

        public AllStreetViewAdaptor(Context context, List<StreetViewModel> list) {
            this.context = context;
            this.list = list;

        }

        @NonNull
        @Override
        public ViewHolder onCreateViewHolder(@NonNull ViewGroup parent, int viewType) {
            return new ViewHolder(LayoutInflater.from(context).inflate(R.layout.thumb_row, parent, false));
        }

        @Override
        public void onBindViewHolder(@NonNull ViewHolder holder, int position) {
            holder.tv_new.setText(list.get(position).getPlaceName());
            holder.ivImage.setImageResource(R.mipmap.ic_launcher);
        }

        @Override
        public int getItemCount() {
            return list.size();
        }

        class ViewHolder extends RecyclerView.ViewHolder {

            TextView tv_new;
            ImageView ivImage;

            ViewHolder(View itemView) {
                super(itemView);
                tv_new = itemView.findViewById(R.id.tvTitle);
                ivImage = itemView.findViewById(R.id.ivImage);
                itemView.setOnClickListener(new View.OnClickListener() {
                    @Override
                    public void onClick(View v) {
                        mPosition = getAdapterPosition();

                        adNumber++;
                        if (adNumber % 2 == 0) {

                            if (mInterstitialAd != null && mInterstitialAd.isLoaded()) {
                                mInterstitialAd.show();
                            } else {
                                onClickListener(mPosition);
                            }
                        } else {
                            onClickListener(mPosition);
                        }


                    }
                });
            }
        }
    }

    private void onClickListener(int mPosition) {
        Uri gmmIntentUri = Uri.parse("google.streetview:cbll=" + placesModelList.get(mPosition).getLatitude() +
                "," + placesModelList.get(mPosition).getLongitude());
        Intent mapIntent = new Intent(Intent.ACTION_VIEW, gmmIntentUri);
        mapIntent.setPackage("com.google.android.apps.maps");
        startActivity(mapIntent);
    }
